import React from 'react';
import './Autorizar.css';
import { FaUser, FaUserPlus } from 'react-icons/fa';

const Autorizar = () => {
  return (
    <div className="autorizar-container">
      <header className="header">Autorizar</header>
      <div className="content">
        <div className="card">
          <FaUser size={60} />
          <p>Iniciar Sesion</p>
        </div>
        <div className="card">
          <FaUserPlus size={60} />
          <p>Nuevo Usuario</p>
        </div>
      </div>
    </div>
  );
};

export default Autorizar;
